  return (
    <div className="app">
      <header className="App-header"></header>
      <Card>
        <CardBT>
          <CardBT.body>
            <Button variant="primary"> Sample</Button>
          </CardBT.body>
        </CardBT>{" "}
      </Card>
    </div>
  );
}

export default App;
